CREATE TABLE IF NOT EXISTS provincias (id INT PRIMARY KEY, nombre VARCHAR(100));
CREATE TABLE IF NOT EXISTS municipios (id INT PRIMARY KEY, nombre VARCHAR(100), provincia_id INT, FOREIGN KEY (provincia_id) REFERENCES provincias(id));
CREATE TABLE IF NOT EXISTS centros (id INT PRIMARY KEY, nombre VARCHAR(255), tipo VARCHAR(100), regimen VARCHAR(50), direccion VARCHAR(255), telefono VARCHAR(20), municipio_id INT, FOREIGN KEY (municipio_id) REFERENCES municipios(id));


